import { Routes, Route } from "react-router-dom"
import Bookings from "./pages/Bookings"
import Home from "./pages/Home"
import "./style.css"
import Homehoc from "./HOC/Homehoc"

function App() {
  return (
    <div className="App">
      <Routes>
        <Route
          path="/"
          element={()=>{<Homehoc></Homehoc>(<Home/>)}}
        ></Route>
        <Route
          path="/bookings"
          element={Homehoc(<Bookings/>)
                }
        ></Route>
      </Routes>
    </div>
  );
}

export default App;
